  [],\n\t\"revision_timestamp\": \"2015-05-07T03:52:38.942649\",\n\t\"name\": \"extensible-data-set-architecture-for-systems-analysis-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The process of aircraft design requires
  the integration of data from individual analysis of aerodynamic, structural, thermal,
  and behavioral properties of a flight vehicle. At present, there is no simple way
  to integrate the results of the analyses early in the design process.  Aurora Flight
  Sciences and the Massachusetts Institute of Technology Aerospace Computational Design
  Laboratory propose to create a system level analysis framework called the Extensible
  Data Set Architecture to facilitate this integration, and therefore provide rapid
  system-wide impact assessment of design changes to a flight vehicle. rnrnThe Extensible
  Data Set Architecture (EDSA) is a generic data storage structure ready for use by
  a diverse and extendable set of software tools and codes. The EDSA can be arbitrarily
  extended to allow additional functionality and provides a natural framework for
  future development of aerospace systems. The framework includes as part of its structure
  the relevant metadata for ensuring version control, traceability, context-specific
  documentation, and interface data for relevant tools, while providing a simple structure
  for extending an existing data set to transparently include new members.rnrnThe
  four primary components of this framework will be 1) an extensible data set used
  by all codes and analysis tools to store and exchange relevant information; 2) a
  tool set which can take advantage of the data set, made up of both existing programs
  and user defined vehicle specific codes; 3) a controller which provides organization,
  operates the tools, and manages iteration and optimization of the design, and 4)
  a display code which presents the results of the analysis to the user. rn\",\n\t\"license_title\":
